    # IMPORTS

    import json
    import requests
    import dateparser
    from skilletlib import SkilletLoader
    from skilletlib.skillet.base import Skillet

    # Disable insecure warnings
    requests.packages.urllib3.disable_warnings()

    # CONSTANTS
    DATE_FORMAT = '%Y-%m-%dT%H:%M:%SZ'


    class Client:

        repo = ''
        branch = ''
        skillets = list()

        skilletLoader = None

        def __init__(self, repo: str, branch: str):
            self.repo = repo
            self.branch = branch

            self.skilletLoader = SkilletLoader()
            self.skillets = self.skilletLoader.load_from_git(repo, 'pan_soar', branch, local_dir='.')
            LOG('SkilletLoader init complete!')

        def list_skillets(self) -> list:
            return self.skillets

        def get_skillet(self, name) -> Skillet:
            return self.skilletLoader.get_skillet_with_name(name)

        def say_hello(self, name):
            return 'hi there'


    class ClientOld(BaseClient):
        """
        Client will implement the service API, and should not contain any Demisto logic.
        Should only do requests and return data.
        """

        def say_hello(self, name):
            return f'Hello {name}'

        def say_hello_http_request(self, name):
            """
            initiates a http request to a test url
            """
            data = self._http_request(
                method='GET',
                url_suffix='/hello/' + name
            )
            return data.get('result')

        def list_incidents(self):
            """
            returns dummy incident data, just for the example.
            """
            return [
                {
                    'incident_id': 1,
                    'description': 'Hello incident 1',
                    'created_time': datetime.utcnow().strftime(DATE_FORMAT)
                },
                {
                    'incident_id': 2,
                    'description': 'Hello incident 2',
                    'created_time': datetime.utcnow().strftime(DATE_FORMAT)
                }
            ]


    def test_module(client):
        """
        Returning 'ok' indicates that the integration works like it is supposed to. Connection to the service is successful.

        Args:
            client: HelloWorld client

        Returns:
            'ok' if test passed, anything else will fail the test.
        """

        result = client.say_hello('DBot')
        if 'Hello DBot' == result:
            return 'ok'
        else:
            return 'Test failed because ......'


    def say_hello_command(client, args):
        """
        Returns Hello {somename}

        Args:
            client (Client): HelloWorld client.
            args (dict): all command arguments.

        Returns:
            Hello {someone}

            readable_output (str): This will be presented in the war room - should be in markdown syntax - human readable
            outputs (dict): Dictionary/JSON - saved in the incident context in order to be used as inputs
                            for other tasks in the playbook
            raw_response (dict): Used for debugging/troubleshooting purposes -
                                will be shown only if the command executed with raw-response=true
        """
        name = args.get('name')

        result = client.say_hello(name)

        # readable output will be in markdown format - https://www.markdownguide.org/basic-syntax/
        readable_output = f'## {result}'
        outputs = {
            'hello': result
        }

        return (
            readable_output,
            outputs,
            result  # raw response - the original response
        )


    def execute_validation_command(client, args):

        skillet_id = args.get('skillet_id')
        ip_address = args.get('ip_address')
        username = args.get('username')
        password = args.get('password')

        context = dict()
        context['ip_address'] = ip_address
        context['username'] = username
        context['password'] = password

        skillet = client.get_skillet(skillet_id)
        skillet.initialize_context(context)

        results = skillet.execute(context)
        LOG(results)

        if skillet.type == 'pan_validation':

            readable_output = f'## Execution Results\n\n'
            readable_output += 'Test  |  Description  |  Result  | Severity  |  More Information\n'
            readable_output += '---  | ---  | ---  | --- | --- \n'

            validation_results = results.get('pan_validation', {})
            output = dict()

            for k, v in validation_results.items():
                res = v.get('results', 'False')
                link = v.get('documentation_link', '')
                label = v.get('label', '')
                severity = v.get('severity', 'low')
                readable_output += f'{k}|{label}|{res}|{severity}|{link}\n'
                output[k] = res
        else:
            # FIXME - handle panos output here
            readable_output = f'## Execution Results'
            readable_output += f'{results}'

        return (
            readable_output,
            output,
            'raw response here'  # raw response - the original response
        )


    def list_skillets_command(client, args):
        skillets = client.list_skillets()
        readable_output = f'## Available Skillets\n\n'
        outputs = dict()
        for s in skillets:
            readable_output += f'* {s.name} - {s.label}\n'
            outputs[s.name] = s.label

        return (
            readable_output,
            outputs,
            'raw response here'  # raw response - the original response
        )


    def main():
        """
            PARSE AND VALIDATE INTEGRATION PARAMS
        """
        repo = demisto.params().get('repo')
        branch = demisto.params().get('branch')

        LOG(f'Command being called is {demisto.command()}')
        try:
            client = Client(
                repo=repo,
                branch=branch)

            if demisto.command() == 'test-module':
                # This is the call made when pressing the integration Test button.
                result = test_module(client)
                demisto.results(result)

            elif demisto.command() == 'pan-os-skilletlib-list':
                return_outputs(*list_skillets_command(client, demisto.args()))

            elif demisto.command() == 'pan-os-skilletlib-validate':
                return_outputs(*execute_validation_command(client, demisto.args()))

        # Log exceptions
        except Exception as e:
            return_error(f'Failed to execute {demisto.command()} command. Error: {str(e)}')


    if __name__ in ('__main__', '__builtin__', 'builtins'):
        main()
